app = Flask(__name__)
CORS(app)

def genname():
    import random
    import string
    letters_and_digits = string.ascii_letters + string.digits
    result_str = ''.join((random.choice(letters_and_digits) for i in range(32)))
    return result_str


def wav2mfcc(file_path, max_len=20):
    sound = am.from_file(file_path, format='wav', frame_rate=22050)
    sound = sound.set_frame_rate(16000)
    sound.export(file_path, format='wav')

    myaudio = AudioSegment.from_file(file_path, "wav")
    chunk_length_ms = 1000  # pydub calculates in millisec
    chunks = make_chunks(myaudio[0:1000], chunk_length_ms)  # Make chunks of one sec
    # Export all of the individual chunks as wav files
    for i, chunk in enumerate(chunks):
        file_path = file_path
        print("exporting", file_path)
        chunk.export(file_path, format="wav")

    wave, sr = librosa.load(file_path, mono=True, sr=None)

    wave = wave[::3]
    mfcc = librosa.feature.mfcc(wave, sr=16000)
    # If maximum length exceeds mfcc lengths then pad the remaining ones
    if (max_len > mfcc.shape[1]):
        pad_width = max_len - mfcc.shape[1]
        mfcc = np.pad(mfcc, pad_width=((0, 0), (0, pad_width)), mode='constant')
    # Else cutoff the remaining parts
    else:
        mfcc = mfcc[:, :max_len]
    return mfcc


def predict(filepath, model):
    labels = ['NĂM', 'MƯỜI', 'MỘT', 'HAI', 'BA', 'SÁU', 'BỐN', 'CHÍN', 'TÁM', 'BẢY']

    feature_dim_1 = 20
    feature_dim_2 = 20
    channel = 1
    sample = wav2mfcc(filepath)
    sample_reshaped = sample.reshape(1, feature_dim_1, feature_dim_2, channel)
    a = labels[np.argmax(model.predict(sample_reshaped))]
    print(a)
    return a

def upload_file_handler():
    if request.values:
        imfile = request.values['audio']
        imfile = imfile.split(',')
        imfile = imfile[1]
        name = genname()
        url = 'audio/' + name + '.wav'
        with open(url, "wb") as f:
            f.write(base64.b64decode(imfile))
        print(url)
        return url
    else:
        return False


@app.route('/predict', methods=['POST'])
def display():
    status = upload_file_handler()
    if status:
        model = load_model('weight2.h5')
        kq = predict(status, model=model)
        print(kq)
        return kq
    else:
        return 'Cannot predict'


